// un ūn ún ǔn ùn（实际拼写为“ūn, ún, ǔn, ùn”）
// ün ǖn ǘn ǚn ǜn（ü+n 的拼音组合）
// ang āng áng ǎng àng
// eng ēng éng ěng èng
// ing yīng yíng yǐng yìng
// ong ōng óng ǒng òng

